import React, { Component } from 'react'
import { connect } from 'react-redux';
import { nextWizardStep } from '../../../redux/actions/wizardActions';


import {
    Row,
    Col,
    Image
} from 'react-bootstrap';


export const WizardConfig = (props) => {
    return (
        <Row className="mt-5">  
            <Col lg={1} />
    
            <Col className="wizard-pages-container" style={{backgroundColor: 'white'}}>
                
                <Row className="d-flex">
                    <Col lg={6} className="d-flex flex-column p-3" style={{backgroundColor: 'red'}}>
                        
                        <div className="d-flex flex-column wizard-config-intent-box">
                            <p className="mr-auto p-2 wizard-config-intent-title">Select Intents</p>
                            
                            <Row className="justify-content-between" style={{backgroundColor: 'purple'}}>
                                {Array.from({ length: 4 }).map((_, index) => (
                                    <Col lg={2} className="" style={{backgroundColor: 'yellow'}}>
                                        <p>Price</p>
                                    </Col>
                                ))}
                            </Row>
                            <p className="ml-auto">2</p>
                        </div>
                        
                    </Col>

                    <Col style={{backgroundColor: 'blue'}} />
                </Row>
    
            </Col>
    
            <Col lg={1} />
        </Row>
        )
}

const mapStateToProps = (state) => ({
    wizardStep: state.wizardR.wizardStep,
})

export default connect(mapStateToProps, {nextWizardStep})(WizardConfig)
